import React from "react";

export default function About() {
  const team = [
    "Jayaprakash S",
    "Vinaya Kumara Liebig K G",
    "Naveen Raj A",
    "Nizamudeen K"
  ];

  return (
    <div className="flex items-center justify-center min-h-screen bg-gray-100 px-6">
      <div className="bg-white shadow-xl rounded-2xl p-10 max-w-2xl w-full">
        <h1 className="text-3xl font-bold text-center mb-6 text-blue-600">
          About This Project
        </h1>

        <p className="text-gray-700 text-lg leading-relaxed mb-8 text-center">
          This application is built as a multi-utility platform providing
          features like AI chat, disease detection, weather information,
          market prices, and personalized recommendations.
        </p>

        <h2 className="text-2xl font-semibold mb-4 text-gray-800 text-center">
          Our Team
        </h2>

        <div className="grid grid-cols-1 gap-4">
          {team.map((member, index) => (
            <div
              key={index}
              className="bg-blue-50 border border-blue-200 rounded-xl p-4 shadow-sm text-center text-gray-800 font-medium"
            >
              {member}
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}
